import React from 'react';
import styles from './Navigation.module.css'

const Navigation = () => {
    return (
        <div className={styles.container}>
            <div>
                <ul>
                    <li>Все</li>
                    <li>Мясные</li>
                    <li>Вегетарианская</li>
                    <li>Гриль</li>
                    <li>Острые</li>
                    <li>Закрытые</li>
                </ul>
            </div>
            <div className={styles.select}>
                Сортировка по:  
            </div>
        </div>
    );
};

export default Navigation;
